import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  //기본 출력물
  const [count, setCount] = useState(3);
  const [Acount, setAcount] = useState(5);


  //int와 string을 구분하는 함수
  const test = (value) => {

    const data = isNaN(value);// int String 비교 , isNaN(이게 int 야? int면 false값을 줌.)
    if(data === false) {
      console.log("int", value);
    }
    else if(data === true){
      console.log("String", value);

    }

    console.log(value); // console.log : 콘솔에 로그 보여달라.
    console.log("data",data);
  }

  <console.log>

  </console.log>



  return (
    <div className="App">
      {count}
      <br />
      {Acount}
      //숫자 버튼
      <button onClick={() => {test(1)}}>
        1
      </button>
      <button onClick={() => {test(2)}}>
        2
      </button>
      <button onClick={() => {test(3)}}>
        3
      </button>
      <button onClick={() => {test(4)}}>
        4
      </button>
      <button onClick={() => {test(5)}}>
        5
      </button>
      <button onClick={() => {test(6)}}>
        6
      </button>
      <button onClick={() => {test(7)}}>
        7
      </button>
      <button onClick={() => {test(8)}}>
        8
      </button>
      <button onClick={() => {test(9)}}>
        9
      </button>
      <button onClick={() => {test(0)}}>
        0
      </button>
      <button onClick={() => {test("+")}}>
        +
      </button>

    </div>
  );
}

export default App;
